import { BrowserRouter } from "react-router-dom";
import "./styles/styles.scss";
import Header from "./templates/header/Header";
import Navbar from "./templates/header/Navbar";
import Footer from "./templates/footer/Footer";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Header />
      <Footer />
    </BrowserRouter>
  );
}

export default App;
